import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'


function NavbarHamburger() {
    return (
        <span class="navbar-hamburger"><button></button></span>
    )
}

function NavbarText() {
    return (
        <span class="navbar-title">Museum</span>
    )
}

function Navbar() {
    return (
        <header class="navbar-box navbar-position navbar-text navbar-flex">
                <NavbarHamburger />
                <NavbarText />
        </header>
    )
}

function Test() {
    return (
        <div class="box">
            a Test
            <button>cool button</button>
        </div>
    )
}

function Manytests() {
    return (
        [
            <Navbar />
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
